// src/components/LandingPage.js
import React from "react";
import "./LandingPage.css";
import Navbar from "./Navbar";

const LandingPage = () => {
  return (
    <div>
      <Navbar />
      <div className="main-container">
        <div>
          <h1>Indian Food is more than curry</h1>
          <p>Try your next new recipe</p>
          <button className="">Get started</button>
          <div className="">
            <img src="samosa.avif" alt="Samosas on wooden board" />
            <img src="dosa.jpg" alt="Dosa with accompaniments" />
            <img src="dish1.jpg" alt="Indian appetizer" />
            <img src="dish2.jpg" alt="Orange appetizers with chutney" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
